import React from 'react';
// import '../../App.css';
import './order.css';

export default function Request() {
      return (
        <div className="order-confirmation-container">
          <h2>Order Details</h2>
          <div className="order-details">
            <div className="order-item">
              <span>Service Type: </span>
              <span style={{
          color: 'brown',
        }}>Vehicle Towing</span>
            </div>
            <div className="order-item">
              <span>Location:</span>
              {/* <span>{this.props.match.params.order_id}</span> */}
              <span>JK Lakshmipat University</span>
            </div>
            <div className="order-item">
              <span>Vehicle Type:</span>
              <span>Four Wheeler</span>
            </div>
            <div className="order-item">
              <span>Vehicle Make:</span>
              <span>Hyundai</span>
            </div>
            <div className="order-item">
              <span>Vehicle Model:</span>
              {/* <span>{orderDetails.vehicleModel}</span> */}
            </div>
            <div className="order-item">
              <span>Additional Details:</span>
              <span>Mechanic Support</span>
            </div>
          </div>
          <p className="confirmation-message">
            Thank you for your order! Our team will be in touch with you shortly.
          </p>
        </div>
    //     <div>
            
        // </div>
    );}
